/*!50003 CREATE*/ /*!50017 DEFINER=CURRENT_USER*/ /*!50003 TRIGGER `trigger_subject_update` AFTER UPDATE ON `subject`
FOR EACH ROW BEGIN
  IF NEW.date_changed <> OLD.date_changed THEN
    INSERT INTO subject_archive (
      topmed_subject_id,
      global_study_id,
      study_subject_id,
      subcohort_id,
      is_sequenced_in_topmed
    )
    SELECT topmed_subject_id, 
           OLD.global_study_id,
           OLD.study_subject_id,
           OLD.subcohort_id,
           OLD.is_sequenced_in_topmed
      FROM subject
      WHERE topmed_subject_id = OLD.topmed_subject_id;
  END IF;
END */;;
